import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Grid,
  Paper,
  Typography,
  Button,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Box,
} from '@mui/material';
import { PlayArrow, Assessment } from '@mui/icons-material';
import { motion } from 'framer-motion';
import axios from 'axios';

const Dashboard = () => {
  const navigate = useNavigate();
  const [quizzes, setQuizzes] = useState([]);
  const [completedQuizzes, setCompletedQuizzes] = useState([]);

  useEffect(() => {
    // Fetch available quizzes and completed quizzes
    const fetchQuizzes = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/student/quizzes');
        setQuizzes(response.data.available || []);
        setCompletedQuizzes(response.data.completed || []);
      } catch (error) {
        console.error('Error fetching quizzes:', error);
      }
    };

    fetchQuizzes();
  }, []);

  const startQuiz = (quizId) => {
    navigate(`/student/quiz/${quizId}`);
  };

  const viewResults = (quizId) => {
    navigate(`/student/results/${quizId}`);
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography variant="h4" gutterBottom component="h1">
          Student Dashboard
        </Typography>

        <Grid container spacing={3}>
          {/* Available Quizzes */}
          <Grid item xs={12} md={6}>
            <Paper
              elevation={3}
              sx={{
                p: 2,
                display: 'flex',
                flexDirection: 'column',
                height: 400,
              }}
            >
              <Typography variant="h6" gutterBottom>
                Available Quizzes
              </Typography>
              <List sx={{ overflow: 'auto', flex: 1 }}>
                {quizzes.map((quiz) => (
                  <ListItem key={quiz.id}>
                    <ListItemText
                      primary={quiz.title}
                      secondary={`Duration: ${quiz.duration} minutes`}
                    />
                    <ListItemSecondaryAction>
                      <IconButton
                        edge="end"
                        color="primary"
                        onClick={() => startQuiz(quiz.id)}
                      >
                        <PlayArrow />
                      </IconButton>
                    </ListItemSecondaryAction>
                  </ListItem>
                ))}
              </List>
            </Paper>
          </Grid>

          {/* Completed Quizzes */}
          <Grid item xs={12} md={6}>
            <Paper
              elevation={3}
              sx={{
                p: 2,
                display: 'flex',
                flexDirection: 'column',
                height: 400,
              }}
            >
              <Typography variant="h6" gutterBottom>
                Completed Quizzes
              </Typography>
              <List sx={{ overflow: 'auto', flex: 1 }}>
                {completedQuizzes.map((quiz) => (
                  <ListItem key={quiz.id}>
                    <ListItemText
                      primary={quiz.title}
                      secondary={`Score: ${quiz.score}%`}
                    />
                    <ListItemSecondaryAction>
                      <IconButton
                        edge="end"
                        color="secondary"
                        onClick={() => viewResults(quiz.id)}
                      >
                        <Assessment />
                      </IconButton>
                    </ListItemSecondaryAction>
                  </ListItem>
                ))}
              </List>
            </Paper>
          </Grid>

          {/* System Requirements Check */}
          <Grid item xs={12}>
            <Paper elevation={3} sx={{ p: 2, mt: 2 }}>
              <Typography variant="h6" gutterBottom>
                System Requirements Check
              </Typography>
              <Box sx={{ display: 'flex', gap: 2, mt: 2 }}>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={() => {/* Implement system check */}}
                >
                  Check Camera
                </Button>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={() => {/* Implement system check */}}
                >
                  Check Microphone
                </Button>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={() => {/* Implement system check */}}
                >
                  Check Internet Speed
                </Button>
              </Box>
            </Paper>
          </Grid>
        </Grid>
      </motion.div>
    </Container>
  );
};

export default Dashboard;
